I want to find the first set of numbers in the string, so the result would be 1234.

#### Best Solution

You can use the following regular expression:
```
/(\d+)/
```
This will match the first set of digits in the string. If you want to match all sets of digits, you can use the following regular expression:
```
/(\d+)/g
```
